import './App.css';
import { BrowserRouter as Router, Routes, Route,useNavigate } from "react-router-dom";
import Navbar from './components/navbar';

function App() {
  const navigate =useNavigate();
  return (
    <div className="App">
      <Navbar/>
      <Router>
            <Routes>
              <Route exact path="/"></Route>
            </Routes>
        </Router>
    </div>
  );
}

export default App;


